import React from 'react';

class ClickCounter extends React.Component {
    render() {
        const { counter } = this.state;
        return (
            <div>
                <button type="button" onClick={this.increment}>
                    click {counter} times
                </button>
            </div>
        );
    }
}
export default ClickCounter;
